import React from 'react';
import {Box,Card,CardActions,CardContent,Button,Typography} from '@mui/material';
import image from '../../Image/background.jpg'
const ProfileCard = () => {
    return(
        <Box sx={{position:'relative'}}>
          <Card sx={{ minWidth: 270,backgroundColor:'white',position:'absolute',right:'10px',mt:1,zIndex:"1",borderRadius:'10px',boxShadow:'0px 0px 30px gray' }}>
      <CardContent>
      <Box sx={{display:'flex',justifyContent:'center',flexDirection:'column',alignItems:'center'}}>
        <img src={image} alt='img' style={{width:'80px',height:'80px',borderRadius:'50%'}} />
        <Typography sx={{fontSize:'20px',color:'gray',mt:1}}>Suresh Pradhan</Typography>
        <Typography sx={{fontSize:'20px',color:'gray'}}>sureshpradhan@gmail.com</Typography>
      </Box>
      </CardContent>
      <CardActions>
        <Button size="small">Learn More</Button>
      </CardActions>
    </Card>
        </Box>
    )
}
export default ProfileCard;
